import React from 'react';
import logo from './logo.svg';
import './App.css';
import SampleContainer from '../src/SampleContainer'

function App() {
  return (
    <div className="App">
      <div className="drumblr">

        <div className="HeaderContainer">
          <div className="DisplayContainer">

          </div>
        </div>

        <div className="NavBar"></div>

        <SampleContainer />

      </div>

    </div>
  );
}

export default App;
